import React from 'react'; 
// import Greating from './Greating';
import * as ques from './Cal';
 
function App(){

return <> 
 <h3> /</h3>
 <h3>/</h3>
 <h3> mul { ques.mul}/</h3>
 <h3> dev{ ques.dev}</h3>

<ul>

<li>sum{ ques.sum}</li>
<li>sub { ques.sub}</li>
<li></li>
<li></li>
</ul>

</>;
 


}
export default App;
